        "but was");
    assertFailureValueIndexed("for key", 0, "ghi");
    assertFailureValueIndexed("expected value", 0, "90");
    assertFailureValue("but got value", "101");
    assertFailureValue("diff", "11");
    assertFailureValueIndexed("for key", 1, "def");
