 */
@GwtIncompatible("reflection")
@J2ktIncompatible
public final class ClassSubject extends Subject {
  private final @Nullable Class<?> actual;

  ClassSubject(FailureMetadata metadata, @Nullable Class<?> o) {
    super(metadata, o);
